import Button from 'react-bootstrap/Button';
import React from 'react';
import { Form } from 'react-bootstrap';
import '../CSS/NewAddress.css';

function newClient() {
  return (
    <div className="new-address-container">
      <Form className="new-address-form">
        <h4>Novo cliente</h4>
        <Form.Group className="mb-1">
          <Form.Label htmlFor="checkout-fullname">
            Nome completo: 
          </Form.Label>
          <Form.Control id="checkout-fullname" type="text" placeholder="Digite seu nome" />
        </Form.Group>
        <Form.Group className="mb-1">
          <Form.Label htmlFor="checkout-cpf">CPF/CNPJ</Form.Label>
          <Form.Control id="checkout-cpf" type="text" placeholder="Digite seu CPF ou CNPJ"/>
        </Form.Group>
        <Form.Group className="mb-1">
          <Form.Label htmlFor="checkout-phone-number">data</Form.Label>
          <Form.Control id="checkout-phone-number" type="text" placeholder="data de nascimento"/>
        </Form.Group>
        <Button variant="success">
          Cadastrar cliente
        </Button>
      </Form>
    </div>
  );
}

export default newClient;
